                        <style>
                        body {
                          font-family: Arial;
                        }

                        input[type=email], select {
                            width: 100%;
                            padding: 12px 20px;
                            margin: 15px 0;
                            display: block;
                            border: 1px solid #ccc;
                            border-radius: 4px;
                            box-sizing: border-box;
                        }

                        input[type=password], select {
                            width: 100%;
                            padding: 12px 20px;
                            margin: 15px 0;
                            display: block;
                            border: 1px solid #ccc;
                            border-radius: 4px;
                            box-sizing: border-box;
                        }

                        input[type=submit] {
                            width: 100%;
                            background-color: #06993f;
                            color: white;
                            padding: 14px 20px;
                            margin: 8px 0;
                            border: none;
                            border-radius: 4px;
                            cursor: pointer;
                        }

                        input[type=submit]:hover {
                            background-color: #0c7033;
                        }

                        div.container {
                            margin: auto;
                            width: 50%;
                            padding: 10px;
                            border: 3px #C0C0C0;
                            border-radius: 10px;
                            background-color: white;
                            width: 350px;
                            padding: 20px;
                            border-style: solid;
                            border-width: thin;
                        }
                        </style>
